#SIFTER:
#compares all positional elements of all points in a potential plane in a given measurement series
#posPlane = Array of points created by the Compare function.  These points all share normals 2 of one another.
#series = Index of measurement series, for reference.
def Sifter(posPlane,series):
	
	floorPlane = []
	pnCT = len(posPlane)
	hold = 0
	chk = 0
	_nn = 'normal['
	_nc = 'coordinate['
	_nx = '].x'
	_ny = '].y'
	_nz = '].z'
	
	while hold < pnCT:
		for i in posPlane:
			
			_a = '{0}{1}{2}'.format(_nn,posPlane[hold],_nx)
			_b = '{0}{1}{2}'.format(_nn,posPlane[hold],_ny)
			_c = '{0}{1}{2}'.format(_nn,posPlane[hold],_nz)
			_x = '{0}{1}{2}'.format(_nc,posPlane[hold],_nx)
			_y = '{0}{1}{2}'.format(_nc,posPlane[hold],_ny)
			_z = '{0}{1}{2}'.format(_nc,posPlane[hold],_nz)
			_x0 = '{0}{1}{2}'.format(_nc,i,_nx)
			_y0 = '{0}{1}{2}'.format(_nc,i,_ny)
			_z0 = '{0}{1}{2}'.format(_nc,i,_nz)
			
			a=gom.app.project.measurement_series[series].results['points'].get (_a)
			b=gom.app.project.measurement_series[series].results['points'].get (_b)
			c=gom.app.project.measurement_series[series].results['points'].get (_c)
			x=gom.app.project.measurement_series[series].results['points'].get (_x)
			y=gom.app.project.measurement_series[series].results['points'].get (_y)
			z=gom.app.project.measurement_series[series].results['points'].get (_z)
			x0=gom.app.project.measurement_series[series].results['points'].get (_x0)
			y0=gom.app.project.measurement_series[series].results['points'].get (_y0)
			z0=gom.app.project.measurement_series[series].results['points'].get (_z0)
			
			numer = abs((a*x)+(b*y)+(c*z)-(a*x0)-(b*y0)-(c*z0))
			denom = math.sqrt((a*a)+(b*b)+(c*c))
			
			D = numer/denom
			#print('Offset Distance: Point[',hold,'] vs Point[',i,'] = ',round(D,2))
			if D < 1:
				chk += 1
		if chk > 3:
			floorPlane.append(posPlane[hold])
		hold = hold + 1
		chk = 0
		#print("-------------------------------------------------------------")
	print('SIFTER - Actual Plane: ',floorPlane)
	return floorPlane
	
#COMPARE:
#Compares the normal angles of all points against every other point in a giver measurement series
#Returns an array of points that have been run through the SIFTER function
#Returned points are within 2 normal to each other, and are coplanar within 1mm
def Compare(mSeries):

	n1 = 'normal['
	n2 = '].x'
	n3 = '].y'
	n4 = '].z'
	posPlane = []
	planeCT = 0
	
	print('[+]Measurement Set: ',gom.app.project.measurement_series[mSeries],'[+]')
	numPTs = gom.app.project.measurement_series[mSeries].results['points'].get ('num_points') - 1
	totPTs = numPTs
	uPTs = 0
	
	while uPTs < totPTs + 1:
		while numPTs > -1:
			try:
				if uPTs != numPTs:
					Unormx = '{0}{1}{2}'.format(n1,uPTs,n2)
					Unormy = '{0}{1}{2}'.format(n1,uPTs,n3)
					Unormz = '{0}{1}{2}'.format(n1,uPTs,n4)
					u1 = gom.app.project.measurement_series[mSeries].results['points'].get (Unormx)
					u2 = gom.app.project.measurement_series[mSeries].results['points'].get (Unormy)
					u3 = gom.app.project.measurement_series[mSeries].results['points'].get (Unormz)
						
					Vnormx = '{0}{1}{2}'.format(n1,numPTs,n2)
					Vnormy = '{0}{1}{2}'.format(n1,numPTs,n3)
					Vnormz = '{0}{1}{2}'.format(n1,numPTs,n4)	
					v1 = gom.app.project.measurement_series[mSeries].results['points'].get (Vnormx)
					v2 = gom.app.project.measurement_series[mSeries].results['points'].get (Vnormy)
					v3 = gom.app.project.measurement_series[mSeries].results['points'].get (Vnormz)
					
					dotProduct = (u1*v1)+(u2*v2)+(u3*v3)
					
				
					
					#Fix Out of range error
					if dotProduct < -1:
						dotProduct = dotProduct +1
					if dotProduct > 1:
						dotProduct = dotProduct -1
					
					
					#print('Degrees Different: Point[',uPTs,'] vs Point[',numPTs,'] = ',round(math.degrees(math.acos(dotProduct)),2))
					
					if round(math.degrees(math.acos(dotProduct)),2) < 2:
						planeCT += 1
				else:
					pass
			except:
				print('Error?')		
		
			numPTs = numPTs - 1
		if planeCT > (totPTs * 0.25):
			posPlane.append(uPTs)
		planeCT = 0
		uPTs = uPTs + 1
		numPTs = totPTs		
	
	print('COMPARE - Possible Plane : ',posPlane)
	floorPlane = Sifter(posPlane,mSeries)
	return floorPlane

#JUNKER:
#The Junker takes all the "junk" points that don't lie on the base plane, and builds them into an array of points that should lie on the part.
#Takes in a measurement series index, for reference - and a plane (Should be the plane returned by the Compare function)
#Returns an array of points that includes all points not on the base plane, for use with transposing
def Junker(Pln,Ser): 

	n1 = 'point_id['
	n2 = ']'
	allPTArray = []
	
	#Builds an array of all points in the Series
	PTs = gom.app.project.measurement_series[Ser].results['points'].get ('num_points') -1
	iPTs = PTs
	while iPTs > -1:
		#print(gom.app.project.measurement_series[Ser].results['points'].get (PTid))
		allPTArray.append(iPTs)
		iPTs -= 1

	x = 0
	junkArray = []
	for a in allPTArray:
		for b in Pln:
			if a == b:
				x = 1
		if x == 0:
			junkArray.append(a)
		x = 0
		
	print('JUNKER - Xpose Points: ',junkArray)
	return(junkArray)

#XPOSE:
#Takes in an array of points for transposing (Should come from the Junker Fucntion)
#Transposes the indexed measurement series provided onto measurement series [0]
#This function does not need to be run on the initial measurement series
#Returns nothing, but performs the transpose gom function	
def XPOSE(pts,Ser):
	n1 = 'coordinate['
	n2 = ']'
	xArray = []
	for i in pts:
		PT = '{0}{1}{2}'.format(n1,i,n2)
		xArray.append(gom.app.project.measurement_series[Ser].results['points'].get (PT))
	print('XPOSE - Sucessfully Transposed!')
	gom.script.atos.transform_by_common_reference_points (reference_measurement_series=gom.app.project.measurement_series[0], source_measurement_series=gom.app.project.measurement_series[Ser], transformation_points=xArray)

#PLNCROP:
#This fucntion performs a 3-point planar crop using points from the Compare function's returned plane
#Uses the first element, the last element, and a random element from the remaining.
#Returns nothing, performs the gom crop function on the indexed measurement series.
def PLNCROP(Pln,Ser):
	n1 = 'coordinate['
	n2 = 'normal['
	n3 = ']'
	
	
	A = Pln[0]
	B = Pln[len(Pln)-1]
	C = Pln[(random.randrange(Pln[1],(len(Pln)-2)))]
	
	
	Anorm = '{0}{1}{2}'.format(n2,A,n3)
	Acoord = '{0}{1}{2}'.format(n1,A,n3)
	an = gom.app.project.measurement_series[Ser].results['points'].get (Anorm)
	ac = gom.app.project.measurement_series[Ser].results['points'].get (Acoord)
		
	Bnorm = '{0}{1}{2}'.format(n2,B,n3)
	Bcoord = '{0}{1}{2}'.format(n1,B,n3)	
	bn = gom.app.project.measurement_series[Ser].results['points'].get (Bnorm)
	bc = gom.app.project.measurement_series[Ser].results['points'].get (Bcoord)
	
	Cnorm = '{0}{1}{2}'.format(n2,C,n3)
	Ccoord = '{0}{1}{2}'.format(n1,C,n3)	
	cn = gom.app.project.measurement_series[Ser].results['points'].get (Cnorm)
	cc = gom.app.project.measurement_series[Ser].results['points'].get (Ccoord)
	
	version = gom.app.get ('application_build_information.version')
	
	if "8" in version:
		gom.script.atos.cut_out_background_points (
			cut_out_points_below_plane=True, 
			measurement_series=[gom.app.project.measurement_series[Ser]], 
			plane_position=2, 
			point1={'normal': an, 'point': ac}, point1_valid=True, 
			point2={'normal': bn, 'point': bc}, point2_valid=True, 
			point3={'normal': cn, 'point': cc}, point3_valid=True)		
			
	else:			
		gom.script.atos.cut_out_points (
			cut_out_points_below_plane=True, 
			measurement_series=[gom.app.project.measurement_series[Ser]], 
			plane_position=2, 
			point1={'normal': an, 'point': ac}, point1_valid=True, 
			point2={'normal': bn, 'point': bc}, point2_valid=True, 
			point3={'normal': cn, 'point': cc}, point3_valid=True)
		
	print('PLNCROP - Base plane Cropped out!')

