#JUNKCROP
#This function crops junk points after polygonizing, based on an area around the CAD model
#This will remove point-bars, putty, etc
#Mesh = Actual Master Mesh name
def JUNKCROP(Mesh):
	
	myMesh = gom.app.project.actual_elements[Mesh]
	totPts = myMesh.get ('num_points')
	gom.script.explorer.apply_selection (selection=myMesh)
	
	i = 2
	while i < 100:
		gom.script.selection3d.deselect_all ()
		j = totPts/i
		gom.script.selection3d.select_patches_by_size (elements=[myMesh], max_points=j)
		mySelection = gom.app.get ('num_selected_visible_points')
		
		if mySelection < totPts:
			gom.script.cad.delete_selected_3d_area (reset_deviation_values=True)
			break
		if i == 99:
			break
		else:
			i = i+1

	print('JUNKCROP - ',Mesh,' Junk Cropped')

